  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112215 includes biological,
  chemical, discrete sample, physical and profile data collected from KEIFU MARU in
  the North Pacific Ocean, Philippine Sea and South Pacific Ocean from 2005-06-15
  to 2005-08-12 and retrieved during cruise PACIFICA_49FA20050615. These data include
  ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
  CHLOROPHYLL A, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION),
  NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta), SALINITY, SIGMA-THETA,
  SILICATE, TOTAL PHOSPHORUS, WATER TEMPERATURE and pH. The instruments used to collect
  these data include CTD, Coulometer for DIC measurement and bottle. These data were
  collected by Kenzou Isa of Japan Meteorological Agency and Masao Ishii of Meteorological
  Research Institute; Geochemical Research Department as part of the PACIFICA_49FA20050615
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
